import React, { Component } from 'react'

state = {
    inputValue: "Hello"
}

class Form extends Component {
    render() {
        return (
            <div className="Form">
                <form>
                    <input 
                        value={this.state.inputValue}  
                    />
                </form>
            </div>
        );
    }
}

export default Form;
